import '../css/card.css';

function card({items}){
    return (
        <div className="card">
            <div className="imgSection">
                <img src="./imgshared/image1.png"></img>
            </div>
            <div className="infoSection">
                <span className="time"></span>
                <span className="info"></span>
                <span className="date"></span>
            </div>
    </div>
    );
}

export default card;
